    public static PdfPTable createTable(boolean align, int numColumns, float borderWidth, int fixedHeight) {
        PdfPTable table = new PdfPTable(numColumns);
        return tableCommonMethod(align, table, borderWidth, fixedHeight);
    }

    public static PdfPTable createTable(boolean align, float[] widths, float borderWidth, int fixedHeight) {
        PdfPTable table = new PdfPTable(widths);
        return tableCommonMethod(align, table, borderWidth, fixedHeight);
    }

    public static PdfPTable createTable(float[] widths, float borderWidth, int fixedHeight) {
        PdfPTable table = new PdfPTable(widths);
        if (fixedHeight > 0) {
            table.getDefaultCell().setMinimumHeight(fixedHeight);
        }
        table.getDefaultCell().setBorderWidth(borderWidth);
        table.getDefaultCell().setHorizontalAlignment(Element.ALIGN_CENTER);
        table.getDefaultCell().setVerticalAlignment(Element.ALIGN_MIDDLE);
        table.setWidthPercentage(100);
        table.setSpacingBefore(0);
        return table;
    }

    private static PdfPTable tableCommonMethod(boolean align, PdfPTable table, float borderWidth, int fixedHeight) {
        if (align) {
            table.setHorizontalAlignment(Element.ALIGN_CENTER);
        }
        if (fixedHeight > 0) {
            table.getDefaultCell().setFixedHeight(fixedHeight);
        }
        table.getDefaultCell().setBorderWidth(borderWidth);
        table.getDefaultCell().setHorizontalAlignment(Element.ALIGN_CENTER);
        table.getDefaultCell().setVerticalAlignment(Element.ALIGN_MIDDLE);
        table.setWidthPercentage(100);
        table.setSpacingBefore(0);
        return table;
    }

    private static PdfPTable tableAddCell(PdfPTable table, String[] text, Font font) {
        for (int i = 0; i < text.length; i++) {
            table.addCell(new Phrase(text[i], font));
        }
        return table;
    }

    private static PdfPTable tableAddCellNoBorder(PdfPTable table, String[] text, Font font) {
        for (int i = 0; i < text.length; i++) {
            PdfPCell cell = new PdfPCell();
            cell.setMinimumHeight(30);
            cell.setPadding(5);
            cell.setUseAscender(true);
            cell.setVerticalAlignment(Element.ALIGN_MIDDLE);
            if (i == 0) {
                cell.disableBorderSide(15);
            }
            if (i == 1) {
                cell.disableBorderSide(7);
            }
            cell.addElement(new Phrase(text[i], font));
            table.addCell(cell);
        }
        return table;
    }


    private static PdfPTable tableAddImgCell(PdfPTable table, String[] text, String[] imgPath, Font font) throws
            IOException, BadElementException {
        int textLength = text.length;
        int imgLength = imgPath.length;
        int textCount = 0;
        int imgCount = 0;
        for (int i = 0; i < textLength + imgLength; i++) {
            if (i % 2 == 0) {
                table.setPaddingTop(5);
                table.addCell(new Phrase(text[textCount++], font));
                continue;
            }
            Image image = Image.getInstance(Base64Utils.decode(" ".getBytes()));
            image.setAlignment(Image.ALIGN_CENTER);
            table.addCell(image);
        }
        return table;
    }

    // 用于嵌套表
    public static PdfPCell createCell(PdfPTable table, float borderWidth) {
        PdfPCell cell = new PdfPCell();
        cell.setColspan(13);
        cell.setBorderWidth(borderWidth);
        cell.addElement(table);
        cell.setPadding(0);
        return cell;
    }

    public static PdfPCell createCell(boolean align, String value, String type, Font font, int colspan,
                                      int rowspan, int padding, int fixedHeight) {
        PdfPCell cell = new PdfPCell();
        // 水平垂直居中
        if (align) {
            cell.setUseAscender(true);
            cell.setVerticalAlignment(PdfPCell.ALIGN_MIDDLE);
            cell.setHorizontalAlignment(Element.ALIGN_CENTER);
            cell.setVerticalAlignment(Element.ALIGN_MIDDLE);
        }
        // 设置单元格内容
        String img = "img";
        if (img.equals(type)) {
            try {
                Image image = Image.getInstance(Base64Utils.decode(value.getBytes()));
                image.setAlignment(Image.ALIGN_CENTER);
                cell.setImage(image);
            } catch (BadElementException e) {
                e.printStackTrace();
            } catch (IOException e) {
                e.printStackTrace();
            }
        } else {
            cell.setPhrase(new Phrase(value, font));
        }
        // 固定高度
        if (fixedHeight > 0) {
            cell.setFixedHeight(fixedHeight);
        }
        cell.setBorderWidth(0.5f);
        cell.setColspan(colspan);
        cell.setRowspan(rowspan);
        cell.setPadding(padding);
        return cell;
    }
